class Routes extends Component {
    state = {  }
    render() { 
        return ( 
            <Router>
      <Navbar/>
      <br/>
      <Route path="/" exact component={HomeScreen}/>
      <Route path="/user"  component={CreateUser}/>
      <Route path="/updateUser" component={UpdateUser}/>
    </Router>
         );
    }
}
 
export default Routes;
